import { Text, TouchableOpacity, View } from 'react-native';
import styles from '../styles/ButtonsStyle';

const AppButton= ({text, navigation}) => {
  return (

      <TouchableOpacity style={styles.appButtonContainer} onPress={() => navigation.navigate(props.route)}>
          <Text style={styles.appButtonText}>{text}</Text>
      </TouchableOpacity>

      //{ /* if props.icon == true ? <show search icon> </show> : appbutonc */ }

  )
}
export default AppButton;
